/**
 * Created by weiyun on 2019/9/12.
 */
import React,{Comonpent} from 'react';
import ReactDOM from 'react-dom';


class Header extends Comonpent{
    constructor(){
        super();
    }
    render(){
        return(
            <div>
                Header
            </div>
        );
    }

    componentDidMount(){
        console.log('Header did mount');
    }

    componentWillUnmount(){
        console.log('Header will unmount');
    }
}

class Content extends Comonpent{
    render(){
        return(
            <div>
                Content
            </div>
        );
    }
    componentDidMount(){
        console.log('Content did Mount');
    }

    componentWillUnmount(){
        console.log('Content will unmount');
    }
}

class Demo1 extends Comonpent{
    constructor(props){
        super(props);
        this.state={
            header:false
        }
    }
    render(){
        return(
            <div>
                {this.state.header?<Header/>:<Content/>}
            </div>
        );
    }
}


export default Demo1;
